lyrics:
Riobanu agenyekwunu;
Choba na unu gachota kwa,
Kubanu agemeghe-kwa-r’unu;
Nwen’okwukwe na Chuku!

Gwam obi uto gi-nwannem:
Gwam obi uto gi-nwannem;
Gwam obi uto gi ebe inamagh Jisus;
Gwam obi uto gi, gwam obi uto gi;
Nwannem gwam obi uto gi ebe inamagh Jisus.

Nwannem okwu, Chineke;
Omasi gi bia, Omasi gi abiala
Okwu Chineke a-ghagh-I-ga n’iru

I will praise Him;
I will praise Him;
I will praise Him for ever more Alleluya!

When He calls me, I will answer;
When He calls me, I will answer;
When He calls me, I will answer;
I’ll be somewhere working for my Lord
Oh! I’ll be somewhere - working
Somewhere - working
Somewhere - working for my Lord
Oh! I’ll be somewhere - working
Somewhere - working
Somewhere - working for my Lord.

Welu ayi lua olu;
Welu ayi lua olu di nma
Chineke nna biko;
Gi welu ayi lua olu di nma (minor).
